// FlightInput.js

import React from 'react';
import './FlightInput.css'; // Import the FlightInput CSS file

const FlightInput = () => {
  const handleFlightInputChange = (e) => {
    // Handle changes in the flight input textbox
    const flightNumber = e.target.value;
    console.log('Flight Number:', flightNumber);
    // Perform any actions based on the flight number input
  };

  return (
    <div className="flight-selector">
      <div className="flight-input-container">
        <label htmlFor="flightInput" className="flight-label">Input Flight Number:</label>
        <input
          type="text"
          id="flightInput"
          placeholder="Enter flight number"
          onChange={handleFlightInputChange}
          className="flight-input"
        />
      </div>
    </div>
  );
};

export default FlightInput;
